        <title>Results Preview</title>
        <style>
            .hidden {
                display: none;
            }
            .exists {
                color: green;
            }
            .missing {
                color: red;
            }

            #rating > span:not(:last-of-type)::after {
                content: "-";
                margin: 0 5px;
            }

            body {
                background-color: #000;
                margin: 0;
                padding: 0;
            }
            #main {
                position: fixed;
                left: 50%;
                top: 50%;
                transform: translate(-50%, -50%);
                text-align: center;
                max-width: 800px;
                max-height: 600px;
                background: #fff;
                padding: 20px;
                overflow-y: scroll;
                overflow-x: hidden;
            }
            .playerContainer > *,
            .thumbnailContainer > * {
                display: block;
            }
            .playerContainer #player {
                width: 100%;
                height: 100%;
            }
            .thumbnailContainer > img {
                width: 100%;
                max-height: 150px;
                object-fit: contain;
            }
        </style>
    </head>
    <body>
        <noscript>
            <style>
                body > *:not(noscript) {
                    display: none;
                }
                noscript > h1 {
                    color: white;
                }
            </style>
            <h1>This website doesn't work without JavaScript. Sorry</h1>
        </noscript>
        <div id="main">
            <select id="videos"></select>
            <div id="videosInfo" class="">
                <div class="thumbnailContainer">
                    <button disabled id="thumbnail-loader">Load thumbnail</button>
                    <img id="thumbnail" height="150" />
                </div>
                <h2 id="title"></h2>
                <div id="rating">
                    <span><span id="views"></span> views</span>
                    <span><span id="likes"></span> likes</span>
                    <span><span id="dislikes"></span> dislikes</span>
                </div>
                <p>Length: <span id="length"></span></p>
                <p>Category: <span id="category"></span></p>
                <p>Created at <span id="creationDate"></span></p>
            </div>
            <div class="playerContainer">
                <button disabled id="player-loader">Start loading video</button>
                <video id="player" controls></video>
            </div>
        </div>
        <script async type="module">
            const offlineData = document.querySelector('[data-dataId="offlineData"]') && JSON.parse(document.querySelector('[data-dataId="offlineData"]').textContent)
            window.getResult = async (id) => offlineData?.results?.[id] ?? await fetch(`/results?item=${id}`).then(r => r.json())
        </script>
        <script async type="module">
            const main = document.querySelector("#main")


            const videos = main.querySelector("#videos")
            

            const videosInfo = main.querySelector("#videosInfo")

            const thumbnailLoader = main.querySelector("#thumbnail-loader")
            const thumbnail = videosInfo.querySelector("#thumbnail")

            const title = videosInfo.querySelector("#title")

            const rating = videosInfo.querySelector("#rating")
            const views = rating.querySelector("#views")
            const likes = rating.querySelector("#likes")
            const dislikes = rating.querySelector("#dislikes")

            const length = videosInfo.querySelector("#length")
            const category = videosInfo.querySelector("#category")
            const creationDate = videosInfo.querySelector("#creationDate")

            const playerLoader = main.querySelector("#player-loader")
            const player = main.querySelector("#player")


            const ids = await getResult("found") ?? {}
            const metas = await getResult("filmotMeta") ?? []
            const sortedMetas = metas
                .sort((a,b) => {
                    const aId = a.videoId;
                    const bId = b.videoId;
                    const aInIds = ids[aId];
                    const bInIds = ids[bId];

                    if (aInIds && !bInIds) return -1
                    if (!aInIds && bInIds) return 1

                    return a.creationDate + b.creationDate
                })

            for(const id of Object.entries(ids).filter(([id]) => !sortedMetas.some(m => m.videoId === id))) {
                const option = document.createElement("option")
                
                option.value = id
                option.textContent = id
                option.classList.add("exists")

                videos.append(option)
            }
            for(const { videoId, title } of sortedMetas) {
                const option = document.createElement("option")
                
                option.value = videoId
                option.textContent =  `${videoId}${title ? ` - ${title}` : ""}`

                if(ids[videoId]) option.classList.add("exists")
                else option.classList.add("missing")
                videos.append(option)
            }

            const updateSelectColor = () => {
                videos.classList.remove("exists", "missing")
                if(ids[videos.value]) videos.classList.add("exists")
                else videos.classList.add("missing")
            }

            videos.addEventListener("change", updateSelectColor)
            updateSelectColor()

            const thumbnailResolutions = [
                "sddefault",
                "mqdefault",
                "default",
            ]
            const findThumbnail = async (id, loadTo) => {
                const baseUrl = `http://web.archive.org/web/2oe_/https://i.ytimg.com/vi/${id}`
                let loaded = false
                let errored = false

                loadTo.onerror = () => errored = true
                loadTo.onload = () => loaded = true

                loadTo.classList.add("hidden")
                thumbnailLoader.setAttribute("disabled", "")

                return new Promise(async r => {
                    for(const resolution of thumbnailResolutions) {
                        errored = false
                        const url = `${baseUrl}/${resolution}.jpg`
                        loadTo.src = url
                        while(!loaded && !errored) await new Promise(resolve => setTimeout(resolve, 100))
                        if(errored) continue
                        if(loaded) {
                            loadTo.onload = null;
                            loadTo.onerror = null;
                            loadTo.classList.remove("hidden")
                            return r(true)
                        }
                    }

                    loadTo.onload = null;
                    loadTo.onerror = null;
                    r(false)
                })
            }

            const updateSelectMeta = async () => {
                videos.setAttribute("disabled", "")
                player.setAttribute("src", "")
                thumbnailLoader.removeAttribute("disabled", "")

                const meta = sortedMetas.find(m => m.videoId === videos.value)

                player.setAttribute("src", "")
                if(ids[videos.value]) playerLoader.removeAttribute("disabled")
                else playerLoader.setAttribute("disabled", "")
                
                if(meta) {
                    title.textContent = meta.title ?? "(No title)"
                    views.textContent = meta.views ?? "???"
                    likes.textContent = meta.likes ?? "???"
                    dislikes.textContent = meta.dislikes ?? "???"
                    length.textContent = meta.length ?? "???"
                    category.textContent = meta.category ?? "???"
                    creationDate.textContent = meta.creationDate ? new Date(meta.creationDate).toLocaleDateString() : "???"
                    videosInfo.classList.remove("hidden")
                }
                else videosInfo.classList.add("hidden")

                videos.removeAttribute("disabled")
                videos.focus()
            }

            videos.addEventListener("change", updateSelectMeta)
            updateSelectMeta()

            const updatePlayer = async () => {
                const src = ids[videos.value]
                if(!src) return;

                playerLoader.setAttribute("disabled", "")
                player.setAttribute("src", src)
            }
            playerLoader.addEventListener("click", updatePlayer)

            const updateThumbnail = async () => findThumbnail(videos.value, thumbnail)
            thumbnailLoader.addEventListener("click", updateThumbnail)
        </script>
    </body>
</html>
